import React, { Component } from 'react';
import { Button } from 'antd';
import logo from './assets/logo.png';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
        <center>
          <div>
          <img src={logo} className="App-logo" alt="logo" />
          </div>
          <br></br>
          <Button type="primary" style={{width:140,backgroundColor:"#563947",borderRadius:10,color:"#f5f9d9"}} block >Login</Button>
        </center>
        </header>
      </div>
    );
  }
}

export default App;
